/* eslint-disable func-style */
/* eslint-disable max-len */
/* eslint-disable require-jsdoc */
function addBlocks (Blockly) {
    const color = '#FF6F00';
    const ksstepperIconUrl = 'data:image/png;base64,';
    
    const digitalPins = Blockly.getMainWorkspace().getFlyout()
        .getFlyoutItems()
        .find(block => block.type === 'arduino_pin_setDigitalOutput')
        .getField('PIN')
        .getOptions();

    Blockly.Blocks.stepper_init = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.KS_STEPPER_INIT,
                args0: [
                    {
                        type: 'field_image',
                        src: ksstepperIconUrl,
                        width: 50,
                        height: 27
                    }
                        
                ],
                args1: [
                    {
                        type: 'field_dropdown',
                        name: 'IN1',
                        options: digitalPins
                    },
                    {
                        type: 'field_dropdown',
                        name: 'IN2',
                        options: digitalPins
                    },
                    {
                        type: 'field_dropdown',
                        name: 'IN3',
                        options: digitalPins
                    },
                    {
                        type: 'field_dropdown',
                        name: 'IN4',
                        options: digitalPins
                    },
                    {
                        type: 'input_value',
                        name: 'steps'
                    },
                    {
                        type: 'input_value',
                        name: 'speed'
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };


    Blockly.Blocks.stepper_step = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.KS_STEPPER_STEP,
                args0: [
                    {
                        type: 'field_image',
                        src: ksstepperIconUrl,
                        width: 50,
                        height: 27
                    }
                        
                ],
                args1: [
                    {
                        type: 'input_value',
                        name: 'stepsNum'
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };


    return Blockly;
}

exports = addBlocks;
